local m = { 
    __index = function(t, k) 
        if k == "toObject" then
            return function()  
                local o = {}
                for key, v in pairs (__key_map) do 
                    o[key] = t._raw[v]
                end
                return o
            end 
        end
        
        assert(__key_map[k], "cannot find " .. k .. " in record_play_info")

        return t._raw[__key_map[k]]
    end
}


function play_info.getLength()
    return #play_info._data
end



function play_info.hasKey(k)
  if __key_map[k] == nil then
    return false
  else
    return true
  end
end


---
--@return @class record_play_info
function play_info.indexOf(index)
    if index == nil or not play_info._data[index] then
        return nil
    end
    return setmetatable({_raw = play_info._data[index]}, m)
end



---
--@return @class record_play_info
function play_info.get(skill_id,advance_id,skin_book_id)
    
    local k = skill_id .. '_' .. advance_id .. '_' .. skin_book_id
    return play_info.indexOf(__index_skill_id_advance_id_skin_book_id[k])
     
end



function play_info.set(skill_id,advance_id,skin_book_id, key, value)
    local record = play_info.get(skill_id,advance_id,skin_book_id)
    if record then
        local keyIndex = __key_map[key]
        if keyIndex then
            record._raw[keyIndex] = value
        end
    end
end




function play_info.get_index_data()
    return __index_skill_id_advance_id_skin_book_id 
end

return  play_info 